function uniqify(links: string[]) {
    return uniqBy(links, (x)=>{
        const dashSplit = x.split('/')
        dashSplit.pop()
        return dashSplit.join('/')
    })
}

export default async function handler(
    req: NextApiRequest,
    res: NextApiResponse<any>
) {
    try {
        switch (req.method) {
            case 'GET': {
                let links = uniqify(flatten(strings.map(string=>{
                    let links = string.split(' ').filter(x=>x.startsWith('https://www.foodiesfeed.com/wp-content/uploads'))
                    return links = uniqify(links)
                })))

                console.log(links.length)
                console.log(JSON.stringify(links))
                res.status(200).end('done')
                break;
            }
            default:
                res.status(405).end('Method Not Allowed')
                break;
        }
    } catch (error) {
        console.error(error)
        res.status(400).end(error)
    }
}